import '../css/cssPageMain.css';

import Paginacao from '../components/paginacao/paginacao';

export default class PageMain extends Component {

    render() {
        const { produtos, page, pages } = this.state;

        return (
          <Paginacao tipo={1} limite={8}/>
        );
    };

}
